  false,\n\t\"url\": null,\n\t\"notes\": \"Habitat maps were created as part of a
  larger ecological assessment conducted by NOAA's National Ocean Service (NOS), Biogeography
  Branch, for Salt River Bay National Historic Park and Ecological Preserve (National
  Park Service).Aerial photographs were obtained for 1988 from the National Geodetic
  Survey, and were orthorectified by the Biogeography Branch. A classification scheme
  was set up with 20 benthic habitat types, 19 land cover types, and 13 mangrove habitat
  types. For this map of seagrass and mangrove habitats during 1988 only the 3 seagrass,
  and 14 mangrove classification categories were used. These were mapped directly
  into a GIS system through visual interpretation of orthorectified aerial photographs.\",\n\t\"owner_org\":
